INSERT INTO `cw_wechat_reply` VALUES ('6', '什么是夺宝', 'click', '0', '99夺宝，是指用户每花费9.9元购买一张汽车美容折扣券，即可获赠1个夺宝币参与夺宝活动，并有机会获得一件奖品（奖品分配对应数量的号码，每个号码价值1个夺宝币）。当一件奖品所有号码分配完毕，根据预先制定的公开规则计算出一个幸运号码，持有该号码者，即获得该奖品。', 'db', '1');
